import { CommonModule } from '@angular/common';

@Component({
  selector: 'app-compete',
  standalone: true,
  imports: [CommonModule],
  templateUrl: './compete.component.html',
  styleUrls: ['./compete.component.css']
})
export class CompeteComponent {


  GotoToRoute(){

  }
}
<div class="cards">
    <div class="card red" routerLink="red-team">
        <p class="tip"> TEAM RED</p>
        <p class="second-text">DEMO</p>
    </div>
    <div class="card blue" routerLink="blue-team" (click)="GotoToRoute()">
        <p class="tip">TEAM BLUE</p>
        <p class="second-text">BLUE</p>
    </div>
</div>
